function Service() {
    return (
      <div className="flex flex-col justify-center items-center	">
        <div className="text-center pb-5 pt-8">
          <h2 className="text-black text-3xl">Our services</h2>
        </div>
        <div>
          <img src="images/companiesLogo.svg" alt="" />
        </div>
      </div>
    );
  }
  
  export default Service;
